  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Injury mortality in the United States
  from 1999 through 2014. Mortality is characterized using the underlying cause of
  death which, for injury deaths, refers to the circumstances of the accident or violence
  that produced the injury. Two concepts are included in the circumstances of an injury
  death: intent of injury and mechanism of injury. Intent of injury describes whether
  the injury was inflicted purposefully (intentional injury) and if purposeful, whether
  the injury was self-inflicted (suicide or self-harm) or inflicted by another person
  (homicide). Injuries that were not purposefully inflicted are considered unintentional
  (accidental) injuries. Mechanism of injury describes the source of the energy transfer
  that resulted in physical or physiological harm to the body. Examples of mechanisms
  of injury include falls, motor vehicle traffic crashes, burns, poisonings, and drownings
  (1,2). This storyboard allows the user to select subcategories of injury deaths
  based on intent and mechanism of injury. Numbers and rates are provided for the
  subcategory selected by the user.</p>n\",\n\t\"license_title\": \"Other License
